import React from "react";

export default function SearchBar({ search, setSearch }) {

    return (
        <input
            className="w-full border p-2 mb-4 rounded"
            type="text"
            placeholder="Search contacts..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
        />
    );
}
